  false,\n\t\"url\": null,\n\t\"notes\": \"The data were downloaded from the COPEPOD
  data base website. The dataset contains zooplankton data from the Institute of Marine
  Research (Bergen Norway) Norwegian Sea survey in April-June during the years 1995
  to 2005. It is total biomass and also biomass of size fractions 180 um, 1000 um
  and 2000 um microns (from the latter we also pick our krill, shrimp and small fishes).
  The samples are taken by WP2 nets from 200-0 m.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
